import React from 'react';
import {
  Container,
  Typography,
  Paper,
  Grid,
  Box,
  Card,
  CardContent,
  List,
  ListItem,
  ListItemText,
  Divider,
} from '@mui/material';
import {
  People as PeopleIcon,
  LocalHospital as VaccinationIcon,
  Assessment as AssessmentIcon,
  Warning as WarningIcon,
} from '@mui/icons-material';

// Sample data
const dashboardData = {
  totalStudents: 1250,
  vaccinatedStudents: 980,
  upcomingDrives: [
    { id: 1, name: 'COVID-19 Booster', date: '2024-03-15', location: 'Main Hall' },
    { id: 2, name: 'Flu Shot', date: '2024-03-20', location: 'Gymnasium' },
  ],
  recentVaccinations: [
    { id: 1, student: 'John Doe', vaccine: 'COVID-19', date: '2024-03-01' },
    { id: 2, student: 'Jane Smith', vaccine: 'Flu Shot', date: '2024-03-02' },
    { id: 3, student: 'Mike Johnson', vaccine: 'COVID-19', date: '2024-03-03' },
  ],
  statistics: {
    vaccinationRate: 78.4,
    pendingVaccinations: 270,
    upcomingAppointments: 45,
  }
};

function StatCard({ title, value, icon, color }) {
  return (
    <Card sx={{ height: '100%' }}>
      <CardContent>
        <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
          {React.cloneElement(icon, { sx: { color, mr: 1 } })}
          <Typography variant="h6" component="div">
            {title}
          </Typography>
        </Box>
        <Typography variant="h4" component="div" sx={{ color }}>
          {value}
        </Typography>
      </CardContent>
    </Card>
  );
}

function Dashboard() {
  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Typography variant="h4" component="h1" sx={{ mb: 4 }}>
        Dashboard
      </Typography>

      {/* Statistics Cards */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Total Students"
            value={dashboardData.totalStudents}
            icon={<PeopleIcon />}
            color="#1976d2"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Vaccination Rate"
            value={`${dashboardData.statistics.vaccinationRate}%`}
            icon={<AssessmentIcon />}
            color="#2e7d32"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Pending Vaccinations"
            value={dashboardData.statistics.pendingVaccinations}
            icon={<VaccinationIcon />}
            color="#ed6c02"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Upcoming Appointments"
            value={dashboardData.statistics.upcomingAppointments}
            icon={<WarningIcon />}
            color="#9c27b0"
          />
        </Grid>
      </Grid>

      {/* Upcoming Drives and Recent Vaccinations */}
      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2, height: '100%' }}>
            <Typography variant="h6" sx={{ mb: 2 }}>
              Upcoming Vaccination Drives
            </Typography>
            <List>
              {dashboardData.upcomingDrives.map((drive, index) => (
                <React.Fragment key={drive.id}>
                  <ListItem>
                    <ListItemText
                      primary={drive.name}
                      secondary={`${new Date(drive.date).toLocaleDateString()} - ${drive.location}`}
                    />
                  </ListItem>
                  {index < dashboardData.upcomingDrives.length - 1 && <Divider />}
                </React.Fragment>
              ))}
            </List>
          </Paper>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper sx={{ p: 2, height: '100%' }}>
            <Typography variant="h6" sx={{ mb: 2 }}>
              Recent Vaccinations
            </Typography>
            <List>
              {dashboardData.recentVaccinations.map((vaccination, index) => (
                <React.Fragment key={vaccination.id}>
                  <ListItem>
                    <ListItemText
                      primary={vaccination.student}
                      secondary={`${vaccination.vaccine} - ${new Date(vaccination.date).toLocaleDateString()}`}
                    />
                  </ListItem>
                  {index < dashboardData.recentVaccinations.length - 1 && <Divider />}
                </React.Fragment>
              ))}
            </List>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Dashboard;
